import { useState, React } from "react";
import { MyContext } from "./Components/context";
import MyComponent from "./Components/MyComponent";

import './App.css';

function App() {
    const [text, setText] = useState("");

    return (
        <div>
            <MyContext.Provider value={{ text, setText }}>
                <MyComponent />
            </MyContext.Provider>
        </div>
    );
}

export default App;
